import React from "react";
// import { Project } from "../Components/Project";
// import { Title } from "../Components/Title";
import projectsData from "../data/ProjectsData";

function Projects() {
  return (
  <div>
    {projectsData.map((project) => {
        return <div>
            <p>{project.id}</p> <p>{project.title}</p>

        </div>
    })}
  </div>
    );
}

export { Projects };
